  \"2016-03-14T18:29:50.018106\",\n\t\"name\": \"2003-ncfmp-lidar-nc-statewide-phase-2\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Airborne LIDAR terrain mapping data acquired
  January through March 2003. Point data (XYZ) in ASCII format. Horizontal datum NAD83(1995)
  North Carolina State Plane feet. Vertical datum NAVD88 US Survey Feet. These data
  may represent a single geographic tile of a larger, county/sub-county data set.
  As such, the map extent indicated in the Spatial_Domain element is representative
  of the larger data set and not an individual tile. The data are organized in 10,000
  ft x 10,000 ft tiles using the NC Bureau of Land Records Management (LRMP) standards.
  Specific information about individual data tiles is included in the data delivery
  index. LAS tiles were received at NOAA OCM.\",\n\t\"license_title\": null,\n\t\"extras\":
